// import Input from "../..UI/Input";
import Input from "../..UI/Input"
import classes from "./MealItem.module.css";
const MealsItemFrom = (props) => {
  return (
    <from className={classes.from}>
      <input
        lable="Amount"
        input={{
          id: "amount",
          type: "number",
          min: "1",
          max: "5",
          step: "1",
          defaultValue: "1",
        }}
      />
      <button>+ Add</button>
    </from>
  );
};
export default MealsItemFrom;
